import React, { useEffect } from 'react';
import Aos from "aos";
import "aos/dist/aos.css";

// import Mainimage from "../public/image/main.jpg";
const FFheader = () => {
  useEffect(() => {
          Aos.init({
            offset: 200,
            duration: 800,
            easing: "ease-in-sine",
            delay: 100,
          });
  }, [])
  return (  
    <>

      {/* ================= MAIN SECTION ================ */}

      <section className="main">
        <div className="main-container">
          <img src="../image/main.jpg" alt="" />
          <div className="main-headlines">
            <span data-aos="slide-up" className="main-words">
              <span className="red">WORK HARDER</span>, GET STRONGER{" "}
            </span>
            <h2 data-aos="slide-up"  className="main-headline">
              EASY WITH OUR <span className="red">GYM</span>
            </h2>
            <button data-aos="flip-down" className="main-headline-login">BECOME A MEMBER</button>
          </div>
        </div>
        <div className="black"></div>
      </section>
    </>
  );
};

export default FFheader;
